import React from "react"

import projects from "../portfolio_data/projects"
import Project from "./Project"

function MainContentPortfolio(){
    const myProjects = projects.map(function(data){
        return <Project key={data.id} project={data}/>
    })
    return (
        // {myProjects}
        <Project />
    )
}

export default MainContentPortfolio
